const MyNotes = () => {
  return (
    <MainScreen title="Welcome back Amir Rajabi">
      <Link to="createnote">
        <Button style={{ marginLeft: 10, marginBottom: 6 }} size="lg">
          Create new Note
        </Button>
        <Card style={{margin:10}}>
          <Card.Header style={{display:"flex"}}>
              <span
              style={{
                  color:"black",
                  textDecoration:"none",
                  flex:1,
                  cursor:"pointer",
                  alignSelf:"center",
                  fontsize:18
              }}
              >title</span>
          </Card.Header>
          <div>
              <Button variamnt="primary">Edit</Button>
              <Button variant="danger" className="mx-2">Delete</Button>
          </div>
        </Card>
      </Link>
    </MainScreen>
  );
};

export default MyNotes;
